import React from 'react';
import {useEffect, useState} from "react";
import "./index.css"
import ConnectionVerifyAPI from "./API/ConnectionVerifyAPI";

function App() {

    const [isConnected, setIsConnected] = useState(false);

    useEffect(() => {
        const response = new ConnectionVerifyAPI();
        response.CheckProxy().then((value) => {
            setIsConnected(value);
        });
    }, []);

    if (isConnected) {
        return (
            <div className={"flex flex-col justify-center items-center h-[100vh] w-full bg-amber-100"}>
                <div>Hello World</div>
                <img src={"./assets/img/f1.jpeg"} className={"w-12 h-10"}/>
                <div></div>
            </div>
        );
    } else {
        return (
            <div className="w-full h-[100vh] flex flex-col justify-center items-center bg-black">
                <img src={"/src/assets/img/f1.jpeg"} className={"w-12 h-10"}/>
            </div>
        );
    }
}

export default App;
